var DOWNLOADCV = DOWNLOADCV || {};
(function (e) {
  "use strict";
  DOWNLOADCV = {
    init: function () {
      var a = felan_template_vars.ajax_url;
      var c = felan_template_vars.package_expires;
      e("body").on("click", "#btn-download-cv-freelancer", function () {
        e.ajax({
          type: "POST",
          url: a,
          data: { action: "felan_freelancer_download_cv" },
          dataType: "json",
          success: function (a) {
            if (a.message) {
              alert(c);
              window.location.reload();
            }
          },
        });
      });
    },
  };
  e(document).ready(function () {
    DOWNLOADCV.init();
  });
})(jQuery);
